import { spacing } from './space';
const container = {
  sm: 640,
  md: 768,
  lg: 1024,
  xl: 1280
};
const sizes = { ...spacing,
  ...{
    '3xs': 224,
    '2xs': 256,
    'xs': 320,
    'sm': 384,
    'md': 448,
    'lg': 512,
    'xl': 576,
    '2xl': 672
  },
  container
};
export default sizes;
